import Link from 'next/link';
import Button from 'react-bootstrap/Button';
import GeneralNav from '../components/GeneralNav'
import Container from 'react-bootstrap/Container'
import Carousel from 'react-bootstrap/Carousel'
import Image from 'react-bootstrap/Image'
import Row from 'react-bootstrap/Row'
import Col from 'react-bootstrap/Col'
export default class Index extends React.Component{
    render(){
        return(
            // < >
            <div>
                <GeneralNav/>
                <Container >
                        <Col xs={6} md={4}>
                            <Image 
                                src= "../static/raul_alcantara_2.PNG"
                                alt = "This is me!"
                                className = "pic"
                                rounded ={true}
                                //roundedCircle = {true}
                                fluid = {true}
                            />
                        </Col>
                    <div>
                        <h1>Raul Alcantara</h1>
                        <p>
                            Hey, I am Raul. I am a student from Peru with a lot of aspirations and dreams.
                            <i>Currently</i>, I am studying at the Massachusetts Institute of Technology (MIT).
                        </p>
                    </div>



                    <Row>
    
                    </Row>
                </Container>
            </div>
            // </>
 
        );
    }
}
